import Editor from "./components/editor";
import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Redirect
} from "react-router-dom";
import uuidV4 from "uuidv4";
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" exact >
            <Redirect to ={`/document/${uuidV4()}}`}/>
          </Route>
          <Route path="/document/:id" element={<Editor/>}/>
        </Routes>

      </Router>

    </div>
  );
}

export default App;
